export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`RedisInsight provides built-in support for the RedisJSON, RediSearch, RedisGraph, Redis Streams, and RedisTimeSeries modules to make it even easier to query, visualize, and interactively manipulate search indexes, graphs, streams, and time-series data. Support for RedisJSON on Redis Cluster was introduced for the first time in RedisInsight v1.8.0. With RedisInsight, you can visualize and edit your JSON data flawlessly.`}</p>
    <p>{`Below steps shows how to get started with RedisJSON using RedisInsight:`}</p>
    <h3 {...{
      "id": "step-1-register-and-subscribe"
    }}>{`Step 1. Register and subscribe`}</h3>
    <p>{`Follow `}<a parentName="p" {...{
        "href": "/create/cloud/rediscloud"
      }}>{`this link to register`}</a>{` and subscribe to Redis Enterprise Cloud`}</p>
    <p><img alt={"RedisJSON"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisjson3.png").default} /></p>
    <h3 {...{
      "id": "step-2-create-a-database-with-redisjson-module"
    }}>{`Step 2. Create a database with RedisJSON Module`}</h3>
    <p><img alt={"RedisJSON"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisjson1.png").default} /></p>
    <h3 {...{
      "id": "step-3-download-redisinsight"
    }}>{`Step 3. Download RedisInsight`}</h3>
    <p>{`To use RedisInsight on a local Mac, you can download from the RedisInsight page on the RedisLabs website:`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link`}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsightmac.png").default} /></p>
    <p>{`Fill out the rest of the form and click “Download.” Please note that the package name is the combination of the platform and version as shown here:`}</p>
    <p>{`redisinsight-platform-version`}</p>
    <h3 {...{
      "id": "step-4-install-redisinsight"
    }}>{`Step 4. Install RedisInsight`}</h3>
    <p>{`Click on the RedisInsight executable and install it in your system.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight2.png").default} /></p>
    <p>{`Head over to your web browser and go to http://localhost:8001`}</p>
    <p>{`Congratulations! You have successfully installed RedisInsight and are now ready to inspect your Redis data, monitor database health, and perform runtime server configuration with this browser-based management interface for your Redis deployment.`}</p>
    <h3 {...{
      "id": "step-5-connect-to-redis-database"
    }}>{`Step 5. Connect to Redis database`}</h3>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight3.png").default} /></p>
    <p>{`Assuming that you already have Redis database up and running, select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight4.png").default} /></p>
    <h3 {...{
      "id": "step-6-add-redis-database"
    }}>{`Step 6. Add Redis Database`}</h3>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password in the form, as shown below. You can skip username for now. Then click “ADD REDIS DATABASE”:`}</p>
    <h3 {...{
      "id": "step-7-execute-json-queries"
    }}>{`Step 7. Execute JSON queries`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` JSON.SET employee_profile . '{ "employee": " { "name": "carol", "age": 40, "married": true } }'
`}</code></pre>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./image_1_1.png").default} /></p>
    <h3 {...{
      "id": "step-8-accessing-redisinsight-browser-tool"
    }}>{`Step 8. Accessing RedisInsight Browser Tool`}</h3>
    <p>{`Select "employee_profile" to display the JSON data `}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./image_1_2.png").default} /></p>
    <h3 {...{
      "id": "step-9-add-a-new-key"
    }}>{`Step 9. Add a new key`}</h3>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./image_1_3.png").default} /></p>
    <h3 {...{
      "id": "step-10-expand-the-json-field"
    }}>{`Step 10. Expand the JSON field`}</h3>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./image_1_4.png").default} /></p>
    <h3 {...{
      "id": "step-11-using-redisinsight-browser-cli"
    }}>{`Step 11. Using RedisInsight Browser CLI`}</h3>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./image_1_5.png").default} /></p>
    <h3 {...{
      "id": "step-12-deleting-the-existing-key"
    }}>{`Step 12. Deleting the existing key`}</h3>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./image_1_6.png").default} /></p>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-python"
        }}>{`RedisJSON and Python`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/storing-complex-json-document"
        }}>{`How to store and retrieve nested JSON document`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-nodejs"
        }}>{`Importing JSON data into Redis using NodeJS`}</a>{` `}</li>
      <li parentName="ul">{`Learn more about `}<a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisjson/"
        }}>{`RedisJSON`}</a>{` in the Quickstart tutorial.`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/shoppingcart"
        }}>{`How to build shopping cart app using NodeJS and RedisJSON`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redislabs.com/blog/index-and-query-json-docs-with-redis/"
        }}>{`Indexing, Querying, and Full-Text Search of JSON Documents with Redis`}</a>{` `}</li>
    </ul>
    </MDXLayout>;
}

;
